import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";

import Main from './screens/Main';
import Budget from './screens/Budget';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" exact component={Main} />
        <Route path="/other" component={Budget} />
      </Routes>
    </Router>
  );
};

export default App;
